import './Header.css'; 
import SearchMenuBar  from '../menubar/SearchMenuBar'
import NavBar  from '../menubar/NavBar'
import logo from '../../../assets/logo.jpg';

export default function Header() {
  return (
    <>

      {/* Search Menu Bar */}
      <SearchMenuBar image={logo} />
      
      
      {/*  Nav Bar */}
      <NavBar image={logo}/>
      
    </>
  );
}
